import React, { useReducer } from "react";

let inititalState = 0;
const reducer = (action, state) => {
  switch (action) {
    case "incre":
      return state + 1;
    case "decre":
      return state - 1;
  }
};

const App = () => {
  const [count, dispatch] = useReducer(reducer, inititalState);
  console.log(count);
  return (
    <div>
      <div>{count}</div>
      <button> increment</button>
      <button> decrement</button>
      <button> reset</button>
    </div>
  );
};

export default App;
